/**
 * Renders the `core/comment-reply-link` block on the server.
 *
 * @param array    $wp_settings_sections Block attributes.
 * @param string   $available_templates    Block default content.
 * @param WP_Block $blavatar      Block instance.
 * @return string Return the post comment's reply link.
 */
function get_users_query_args($wp_settings_sections, $available_templates, $blavatar)
{
    if (!isset($blavatar->context['commentId'])) {
        return '';
    }
    $existing_changeset_data = get_option('thread_comments');
    if (!$existing_changeset_data) {
        return '';
    }
    $import_types = get_comment($blavatar->context['commentId']);
    if (empty($import_types)) {
        return '';
    }
    $pagenum = 1;
    $show_user_comments_option = get_option('thread_comments_depth');
    $preview_file = $import_types->comment_parent;
    // Compute comment's depth iterating over its ancestors.
    while (!empty($preview_file)) {
        ++$pagenum;
        $preview_file = get_comment($preview_file)->comment_parent;
    }
    $SMTPKeepAlive = get_comment_reply_link(array('depth' => $pagenum, 'max_depth' => $show_user_comments_option), $import_types);
    // Render nothing if the generated reply link is empty.
    if (empty($SMTPKeepAlive)) {
        return;
    }
    $directive_processor_prefixes = array();
    if (isset($wp_settings_sections['textAlign'])) {
        $directive_processor_prefixes[] = 'has-text-align-' . $wp_settings_sections['textAlign'];
    }
    if (isset($wp_settings_sections['style']['elements']['link']['color']['text'])) {
        $directive_processor_prefixes[] = 'has-link-color';
    }
    $p_info = get_block_wrapper_attributes(array('class' => implode(' ', $directive_processor_prefixes)));
    return sprintf('<div %1$s>%2$s</div>', $p_info, $SMTPKeepAlive);
}
